import React from "react";

let styles = {
  text: {
    color: "white"
  }, 
  background: {
    background: "purple"
  }
}

const NavBar = () => {
  return <div className="navbar navbar-light bg-light">
    <div className="navbar brand" href="#">Clicky Game</div>
    <div className="navbar-text">Score</div>
  </div>  
};

export default NavBar;
